import React from 'react';
import {Link} from 'react-router-dom'
import PageDefault from '../../../components/PageDefault';

function CadastroCategoria(){
    return(
        <PageDefault>
        <h1>Cadastro Categoria</h1>

        <form>

            <label>
                Nome da Categoria
            </label>
        </form>


            <Link to="/">
                Ir para home
            </Link>
        </PageDefault>

    )
}

export default CadastroCategoria;
